import React from 'react';

// The base64 string for the USACE logo
const LOGO_BASE64 = "data:image/png;base64,";

interface LogoProps {
    className?: string;
}

const Logo: React.FC<LogoProps> = ({ className }) => {
    return (
        <img 
            src={LOGO_BASE64} 
            alt="USACE Logo" 
            className={className} 
        />
    );
};

export default Logo;
